function getSecId() {
    var guid = "";
    for (var i = 1; i <= 32; i++) {
        var n = Math.floor(Math.random() * 16.0).toString(16);
        guid += n;
        if ((i == 8) || (i == 12) || (i == 16) || (i == 20))
            guid += "-";
    }
    return "wap"+guid;
}
//url 接口地址‘/100103/10010301’, secId，parames，token没有传null，random到毫秒的时间戳
function sign(url, secId, params, token, random) {
    return base64encode(hex_md5(url + secId + params + token + random) + "," + random);
}

//{'params':'encodeParams(密码,loginName:password:hostCity)', 'sign':sign}
function encodeParams(key, params) {
    return LcfDes.encrypt(key, params);
}

function decodeParams(key, data) {
    return LcfDes.decrypt(key, data);
}

//写入cookie
function setCookie(c_name,value,expiredays){
    var exdate=new Date();
    exdate.setDate(exdate.getDate()+expiredays);
    document.cookie=c_name+ "=" +escape(value)+
        ((expiredays==null) ? "" : ";expires="+exdate.toGMTString())+";path=/";
}
//读取cookie
function getCookie(c_name){
    if (document.cookie.length>0){
        c_start=document.cookie.indexOf(c_name + "=");
        if (c_start!=-1){
            c_start=c_start + c_name.length+1;
            c_end=document.cookie.indexOf(";",c_start);
            if (c_end==-1) c_end=document.cookie.length;
            return unescape(document.cookie.substring(c_start,c_end))
        }
    }
    return ""
}


